const PRODUCTS_BASE_URL = '/api/projects';

async function fetchProjects() {
    const response = await fetch(PRODUCTS_BASE_URL)
    if (!response.ok) throw new Error('Failed to fetch projects')

    const projects = await response.json()
    return projects
}

export default {
    fetchProjects
};
